import React from "react";
import styled from "styled-components";
import Navbar from "./NavBar";

const Container = styled.div`
  width:100%;
`;

const Home = () => {
  return (
    <Container>
      <Navbar />
      <h1>Home Page</h1>
    </Container>
  );
};

export default Home;
